import Logo from "./img/logo.png";
import "./header.scss";

const Header = () => {


    return (

        <header className="header">

            <div>
                <figure className="header-logo">
                    <img src={Logo} />
                </figure>
                <nav className="header-nav">

                    <ul>
                        <li>mais</li>
                        <li>produtos</li>
                        <li>venda</li>
                        <li>contato</li>
                    </ul>
                </nav>
            </div>


        </header>
    )

}

export default Header;
